import React from 'react';
import './style.css';

import Search from './Search';
import AddStartUp from './AddStartUp';

class navbar extends React.Component {
  handleClick(){
    console.log("click")
  }
  
  render() {
    return (
      <div className="navbar">
        <span onClick={()=> this.handleClick()} className="name">{this.props.name}</span>
        <Search />
        <AddStartUp action="Agregar Startup" />
      </div>
    );
  }
}

export default navbar;
